We can take a slightly different approach and create a container for an optional value using discriminated unions: type None = { readonly _tag: "None";
}; type Some<A> = { readonly _tag: "Some"; readonly value: A;
}; type Option<A> = None | Some<A>; Even though this looks very similar to a plain union like we've used with Nullable, this approach will allow us to build some very powerful abstractions that will allow us to reason about our code on a higher level. We also need a way how to create Options and check which variant we have, Some or None. // constructors
const some = <A>(a: A): Option<A> => ({ _tag: "Some", value: a });
const none: Option<never> = { _tag: "None" }; // guards
const isSome = <A>(fa: Option<A>): fa is Some<A> => fa._tag === "Some";
const isNone = <A>(fa: Option<A>): fa is None => fa._tag === "None"; So, now we can create and check options, but it would be pretty tedious to write code like this directly. Instead we can use these to create more elaborate constructors like fromPredicate and use these guards to create a pattern matching function match // Constructs a Some instance if predicate returns true, otherwise returns None
const fromPredicate = <A>(predicate: (a: A) => boolean) => (value: A): Option<A> => predicate(value) ? some(value) : none; // Evaluates appropriate handler based on whether an Option is Some or None
const match = <B, A>(onNone: () => B, onSome: (a: A) => B) => (ma: Option<A>) => isNone(ma) ? onNone() : onSome(ma.value); We can create an option using fromPredicate like this: const optionalNumber = pipe( Math.random(), fromPredicate((n) => n > 0.5)
); // Option<number> The above code will create Some instance only if the predicate functions returns true for a given input. Otherwise, it will return None. We can use match to pattern match against these two possibilities: const result = pipe( Math.random(), fromPredicate((n) => n > 0.5), match( // None handler () => "Number was lower than 0.5", // Some(n) handler (n) => `Number value: ${n}` )
); // string We cannot decide not to handle both cases, that would be a type error. Sometimes we just want to handle extract the value in case of Some, and handle the None case. We could do this with match, but we can also use getOrElse and getOrElseW pipe( someOption, match( () => 1 // return default value in case of `None` n => n // or return n in case of `Some` )
) // we can simplify above by using `getOrElse`
import * as O from "fp-ts/Option"; pipe( someOption, O.getOrElse(() => 1)
); Both match and getOrElse need to return the same type from both branches, so that the resulting value is a single type. We can also widen the result by using getOrElseW. In fp-ts, W suffix means widen and functions that end with W aggregate types from different branches into a type union const result = pipe( O.some(1), O.getOrElseW(() => "hello")
); // number | string There are a couple of more useful helpers: import * as O from "fp-ts/Option"; O.fromNullable(null); // O.None
O.fromNullable(undefined); // O.None
O.fromNullable(""); // O.Some("") O.toNullable(O.some("hello")) // "hello"
O.toNullable(O.none)) // null O.toUndefined(O.some("hello")) // "hello"
O.toUndefined(O.none)) // undefined So far, we've managed to create a specialized container, create some helper constructors and guards and a pattern matching tool. We will now build on this by making our Option a Functor!

