A referentially transparent expression is one that can be replaced with its result without changing the result of the program. It always returns the same value whenever it's evaluated with the same inputs. It makes reasoning about our programs easier and reduces complexity. The following expression is referentially transparent: const add = (x, y) => x + y; add(2, 3) === 5;
// In any expression, add(2,3) can be freely substituted with the value 5
// without changing the result of the program. This expression, on the other hand, cannot be freely substituted with it's value because the evaluation of add also creates a side effect , logging in this case: const add = (x, y) => { console.log(x, y); return x + y;
}; If we substituted add(2,3) with value 5, we would not evaluate console.log and would thus change the behavior of the program. We call functions like these impure .

