There is no direct mutation and instead values, once created, are unchangeable. New values are created by applying functions to the old values. // mutable style
let value = 1;
value += 1; // immutable style
const increment = (x) => x + 1;
const value = 1;
const newValue = increment(value); Unfortunately, Typescript being a superset of Javascript, doesn't natively support immutability so we have to be extra careful not to mutate values. Some other languages like Haskell and Clojure implement immutable data structures efficiently; Javascript will pay additional memory overhead which is well worth it in majority of situations for application development as it makes the programs easier to debug and reason about.
